import React from "react";

const CategoryCard = ({ img, title, to }) => {
  return (
    <div class="card w-48">
      <div class="card-header">
        <img src={img} alt={title} class="img h-40 w-full cover" />
      </div>
      <div class="card-bottom">
        <div class="card-body">
          <div class="card-title">{title}</div>
        </div>
        <div class="card-footer">
          <div class="row gap-1 items-center w-full ">
            <a href={to} id="browse-more-btn" class=" btn btn-dark">
              Browse More
            </a>
            <button class=" btn-round-md bg-pink text-light">
              <i class="fa fa-heart"></i>
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CategoryCard;
